@Dinesh D'Souza -- I'm disappointed with the poor explanation of the A.I. (Artificial Intelligence) problem in this video. Using phrases like "back end data" means next to nothing to the average person and this kind of technical jargon is unnecessary. Here's the simplest way I know to explain what is happening with media content censorship via A.I.: (1) All A.I. systems need to be trained. (2) You train them by feeding them data and identifying it. For example, to train an A.I. to recognize bad videos, you show it examples of good and bad videos. (3) In this case the "2000 Mules" video was fed to the A.I. and it was labeled as "bad". So the A.I. will flag "2000 Mules" and other videos like it.

To discover the facts, you need to obtain the data that was fed to the A.I. and you need to know how it was identified to the A.I. If all the liberal videos are labeled "good" and all the conservative videos are labeled "bad" when you train the A.I., it will naturally produce unbalanced and poor results. In this way, the people who train an A.I. have tremendous power to skew its performance in biased and/or dangerous directions.

You do not need to be an expert to understand the above. It's quite simple. The same thing is happening in our schools -- children are being taught lies as truth. So what do you think they will believe? It's the same principal with training an A.I. with one giant exception. Children can think, so there is a chance they may discover that they've been lied to. An A.I. cannot think -- it has no consciousness -- so it has zero chance to recognize when it's being lied to if the truth contradicts its training.
